import { Injectable } from "@angular/core";
import { INumberEqualCondition } from "./INumberEqualCondition";

///////////////////////////////////////////////////////////////////

@Injectable()
export abstract class INumberIsOdd implements INumberEqualCondition {
    abstract isEqual(number: number): boolean;
}
